                        assertThat(
                                startNewWorkerFuture.get(TIMEOUT_SEC, TimeUnit.SECONDS),
                                is(true));
                        assertThat(
                                taskExecutorProcessSpec1,
                                is(
                                        TaskExecutorProcessUtils
                                                .processSpecFromWorkerResourceSpec(
                                                        flinkConfig, WORKER_RESOURCE_SPEC)));


