public void handleFailedResponse(int requestId, @Nullable Throwable cause) {
    synchronized (lock) {
        if (isShutDown) {
            return;
        }

        PendingStatsRequest<T, V> pendingRequest = pendingRequests.remove(requestId);
        if (pendingRequest != null) {
