public boolean equalTo(MemorySegment seg2, int offset1, int offset2, int length) {
    int i = 0;



    while (i <= length - 8) {
        if (getLong(offset1 + i) != seg2.getLong(offset2 + i)) {
            return false;
        }
        i += 8;
    }


    while (i < length) {
        if (get(offset1 + i) != seg2.get(offset2 + i)) {
            return false;
        }
        i += 1;
    }

    return true;
}

