    Configuration testFlinkConf = new Configuration();

    testFlinkConf.set(
            SecurityOptions.SECURITY_CONTEXT_FACTORY_CLASSES,
            Lists.newArrayList(
                    AnotherCompatibleTestSecurityContextFactory.class.getCanonicalName(),
