      setFlags(C.BUFFER_FLAG_KEY_FRAME);
    }
  }
  if (buffer.isDecodeOnly()) {
    setFlags(C.BUFFER_FLAG_DECODE_ONLY);
  }
  @Nullable ByteBuffer bufferData = buffer.data;
