private int findNoisePosition(ByteBuffer buffer) {

  for (int i = buffer.position(); i < buffer.limit(); i += 2) {
    if (Math.abs(buffer.getShort(i)) > silenceThresholdLevel) {

      return bytesPerFrame * (i / bytesPerFrame);
    }
  }
  return buffer.limit();
}

