public static String trimTrailingCharacter(String str, char trailingCharacter) {
	if (!hasLength(str)) {
		return str;
	}

	int endIdx = str.length() - 1;
	while (endIdx >= 0 && trailingCharacter == str.charAt(endIdx)) {
		endIdx--;
	}
	return str.substring(0, endIdx + 1);
}

