	target.setAge(27);
	NopInterceptor nop = new NopInterceptor();
	ControlFlowPointcut cflow = new ControlFlowPointcut(One.class);
	Pointcut settersUnderOne = Pointcuts.intersection(Pointcuts.SETTERS, cflow);
