	if (separatorIndex != -1) {
		String jarFile = urlFile.substring(0, separatorIndex);
		try {
			return new URL(jarFile);
		}
		catch (MalformedURLException ex) {


			if (!jarFile.startsWith("/")) {
				jarFile = "/" + jarFile;
			}
			return new URL(FILE_URL_PREFIX + jarFile);
		}
	}
	else {
		return jarUrl;
	}
}

