	catch (IllegalStateException ex) {
		throw ex;
	}
	catch (Throwable ex) {
		throw new IllegalStateException("Could not load TestContextBootstrapper [" + clazz +
				"]. Specify @BootstrapWith's 'value' attribute or make the default bootstrapper class available.",
				ex);
	}
}

