	String suffix = (this.pattern.endsWith("*") ? ".*" : "");
	String regex = Arrays.stream(this.pattern.split("\\*"))
			.filter(s -> !s.isEmpty())
			.map(Pattern::quote)
			.collect(Collectors.joining(".*", prefix, suffix));
	return Pattern.compile(regex);
}

