static long multiplyFraction(long x, long numerator, long denominator) {
  if (x == 1) {
    return numerator / denominator;
  }
  long commonDivisor = gcd(x, denominator);
  x /= commonDivisor;
  denominator /= commonDivisor;


  return x * (numerator / denominator);
}

